LEGO Batman: The Movie - DC Super Heroes Unite (2013) (WEB-DL - MP4 - English)
------------------------------------------------------------------------------

When Bruce Wayne receives the Man of the Year award, fellow billionaire Lex Luthor
becomes jealous and decides to run for President. To create the atmosphere for his
type of fear-based politics, Lex recruits The Joker to perfect a Black LEGO
Destructor Ray which wreaks havoc on Gotham. As Lex destroys Batman's tech,
Batman reluctantly turns to Superman for help.

Actors: Troy Baker, Christopher Corey Smith and Laura Bailey.
Writers: Jon Burton and David A. Goodman.
Director: Jon Burton.

Produced by DC Comics, LEGO Group, Traveller's Tales and Warner Premiere Digital.

